import React from "react";

function Websites({ websites }) {
    console.log("hi", websites.length);
    if (websites.length > 0) {
        return (
          <ul>
            {websites.map((website) => (
              <li>
                <a href={website} className="texzt-blue"> {website}</a>
              </li>
            ))}
          </ul>
        );
    }
  return (
    <></>
  );
}

export default Websites;
